-- Flatten board row-major (top row first, leftright)
local function flattenBoard(board)
    local str = {}
    for row = ROWS, 1, -1 do
        for col = 1, COLS do
            table.insert(str, board[col][row] ~= "" and board[col][row] or ".")
        end
    end
    return table.concat(str)
end

-- Decide if outcome favors bot
local function isWinningPath(outcome, isBotFirst)
    if isBotFirst then
        return outcome == 9  -- first player win
    else
        return outcome == 3  -- second player win
    end
end

-- Find next move from OpeningBook
local function findNextMoveInBook(flatBoard, isBotFirst)
    for key, outcome in pairs(OpeningBook) do
        if string.sub(key, 1, #flatBoard) == flatBoard then
            if isWinningPath(outcome, isBotFirst) then
                -- find where board differs
                for i = 1, COLS * ROWS do
                    if flatBoard:sub(i,i) == "." and key:sub(i,i) ~= "." then
                        local col = ((i-1) % COLS) + 1
                        return col
                    end
                end
            end
        end
    end
    return nil
end

-- Check win
local function checkWin(board, player)
    -- Horizontal
    for r = 1, ROWS do
        for c = 1, COLS-3 do
            if board[c][r]==player and board[c+1][r]==player and board[c+2][r]==player and board[c+3][r]==player then
                return true
            end
        end
    end
    -- Vertical
    for c = 1, COLS do
        for r = 1, ROWS-3 do
            if board[c][r]==player and board[c][r+1]==player and board[c][r+2]==player and board[c][r+3]==player then
                return true
            end
        end
    end
    -- Diagonal /
    for c = 1, COLS-3 do
        for r = 4, ROWS do
            if board[c][r]==player and board[c+1][r-1]==player and board[c+2][r-2]==player and board[c+3][r-3]==player then
                return true
            end
        end
    end
    -- Diagonal \
    for c = 1, COLS-3 do
        for r = 1, ROWS-3 do
            if board[c][r]==player and board[c+1][r+1]==player and board[c+2][r+2]==player and board[c+3][r+3]==player then
                return true
            end
        end
    end
    return false
end

-- Minimax with alpha-beta pruning
local function minimax(board, depth, alpha, beta, maximizing)
    if checkWin(board, BOT) then return 1000, nil end
    if checkWin(board, OPP) then return -1000, nil end

    local full = true
    for c = 1, COLS do
        if board[c][ROWS]=="" then full=false break end
    end
    if full or depth==0 then return 0, nil end

    local bestCol = nil
    if maximizing then
        local maxEval = -math.huge
        for c = 1, COLS do
            for r = 1, ROWS do
                if board[c][r]=="" then
                    board[c][r] = BOT
                    local eval,_ = minimax(board, depth-1, alpha, beta, false)
                    board[c][r] = ""
                    if eval > maxEval then
                        maxEval = eval
                        bestCol = c
                    end
                    alpha = math.max(alpha, eval)
                    if beta <= alpha then break end
                    break
                end
            end
        end
        return maxEval, bestCol
    else
        local minEval = math.huge
        for c = 1, COLS do
            for r = 1, ROWS do
                if board[c][r]=="" then
                    board[c][r] = OPP
                    local eval,_ = minimax(board, depth-1, alpha, beta, true)
                    board[c][r] = ""
                    if eval < minEval then
                        minEval = eval
                        bestCol = c
                    end
                    beta = math.min(beta, eval)
                    if beta <= alpha then break end
                    break
                end
            end
        end
        return minEval, bestCol
    end
end

-- Main bot function
function getBestMove(board)
    local flat = flattenBoard(board)
    -- detect if bot is first player (count pieces)
    local botCount, oppCount = 0, 0
    for c = 1, COLS do
        for r = 1, ROWS do
            if board[c][r]==BOT then botCount+=1 end
            if board[c][r]==OPP then oppCount+=1 end
        end
    end
    local isBotFirst = (botCount <= oppCount)

    -- Try OpeningBook first
    local move = findNextMoveInBook(flat, isBotFirst)
    if move then return move end

    -- fallback: minimax depth 5
    local _, bestCol = minimax(board, 5, -math.huge, math.huge, true)
    return bestCol
end




